import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import AccountComponentContainer from './Account Container Component/AccountComponentContainer';
import { data } from './Data';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/acc" element={<AccountComponentContainer data={data}/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
